import React, { useEffect, useState } from 'react';
import axios from 'axios';

function Table() {
    const [journals, setjournal] = useState([]);
    const [currentpage, setcurpage] = useState(1);
    const [itemperpage, setitemperpage] = useState(5);

    const pages =[];
    

    for (let i = 1; i <= Math.ceil(journals.length/itemperpage); i++) {
            pages.push(i);
    }
    const reanderpagenumber = pages.map((nb)=> {
        return (
            <li key = {nb} id = {nb}>{nb}</li>
        );
    })
    
    const payload = {"filter":"{}",
        "ignoreAssociation": true,
        "isPaginateDB": true,
        "modelType": "journals",
        "page":1,
        "pageSize":100
      };
    useEffect(() => {
      axios.post('http://o-research-dev.orlab.com.vn/api/v1/filters/filter/', {payload})
        .then(res => {
          setjournal(res.data.data);
        })
    })
    
    return (
        <table className="table">
            <thead>
            <tr>
                <th>Id</th>
                <th>Title</th>
                <th>Totaldocs</th>
                <th>Country</th>
                <th>Publisher</th>
                <th>Year</th>
            </tr>
            </thead>
            <tbody>
            {journals.map((data, index) =>(
            <tr key={data.id}>
              <td>{data.id}</td>
              <td>{data.title}</td>
              <td>{data.totalDocs}</td>
              <td>{data.country}</td>
              <td>{data.publisher}</td>
              <td>{data.year}</td>
            </tr>
        ))}
            </tbody>
        </table>
      );
    
}

export default Table;
